import React from 'react'
import styled from 'styled-components';

const P = styled.p`
  color: #676767;
  font-size: 12px;
  font-weight: 600;
`;

const Paragraph = () => {
         return <P href="">Een paragraaf</P>
}

export default Paragraph;
